s of the `SecurityContext` we should add methods to the `SecurityContextHolder` that allow setting and getting a `Supplier<SecurityContext>`. A benefit is that if it takes some work to obtain the `SecurityContext`, the it is only looked up if necessary.

For example, currently the `SecurityContext` is looked up from the `HttpSession` for every page. When using distributed sessions (i.e. Spring Session + Redis) this is a lot of unnecessary overhead for accessing public css, javascript, and images. With these changes Spring Security can avoid accessing the `HttpSession` for public resources like javascript, css, images, public html pages, etc.

The context would be set like this:

```java
SecurityContextHolder.setDeferredContext(() -> securityContextRepository.loadContext(...));
```

Then code that wasn't sure if the `SecurityContext` was needed could use:

```java
Supplier<SecurityContext> deferredContext = SecurityContextHolder.getDeferredContext();

authorizationManager.check(() -> defferedContext.get().getAuthentication(), object);
```

These changes will largely be internal and not impact users.", 'reactions': {'url': 'https://api.github.com/repos/spring-projects/spring-security/issues/10913/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/spring-projects/spring-security/issues/10913/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/spring-projects/spring-security/issues/comments/1054403670', 'html_url': 'https://github.com/spring-projects/spring-security/issues/10913#issuecomment-1054403670', 'issue_url': 'https://api.github.com/repos/spring-projects/spring-security/issues/10913', 'id': 1054403670, 'node_id': 'IC_kwDOADAMs84-2OxW', 'user': {'login': 'rwinch', 'id': 362503, 'node_id': 'MDQ6VXNlcjM2MjUwMw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/362503?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/rwinch', 'html_url': 'https://github.com/rwinch', 'followers_url': 'https://api.github.com/users/rwinch/followers', 'following_url': 'https://api.github.com/users/rwinch/following{/other_user}', 'gists_url': 'https://api.github.com/users/rwinch/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/rwinch/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/rwinch/subscriptions', 'organizations_url': 'https://api.github.com/users/rwinch/orgs', 'repos_url': 'https://api.github.com/users/rwinch/repos', 'events_url': 'https://api.github.com/users/rwinch/events{/privacy}', 'received_events_url': 'https://api.github.com/users/rwinch/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-02-28T15:59:34Z', 'updated_at': '2022-02-28T15:59:34Z', 'author_association': 'MEMBER', 'body': "@linghengqian You would still be allowed to use the methods that you provided, but there will be additional methods to support delayed lookup of the `SecurityContext`. I've updated th